import React from 'react';
import './App.css';
import ReviewAudiences from './ReviewAudiences';

class App extends React.Component {
  render() {
    return (
      <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
          <div className="container">
            <a className="navbar-brand" href="/">Ranter</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
              aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav ml-auto">
                <li className="nav-item">
                  <a className="nav-link" href="/">Home</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="/">Review</a>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        <div className="container mt-5">
          <h1>Welcome to Ranter!</h1>
          <p>Are you tired of struggling to find the perfect rental property? Look no further than Ranter! Our platform provides tenants with the most current and authentic reviews from previous renters, helping you to find your ideal home. Say goodbye to the guesswork and frustration of the rental search process and say hello to the ease and convenience of Ranter!</p>
        </div>

        <ReviewAudiences />
      </div>
    );
  }
}

export default App;
